<h3 id="english" tabindex="-1"><a class="header-anchor" href="#english" aria-hidden="true">#</a> English</h3>
<p>A well-known scientist (some say it was <mark>Bertrand Russell</mark>) once gave a public lecture on astronomy. He described how the earth orbits around the sun and how the sun, in turn, orbits around the center of a vast collection of stars called our galaxy. At the end of the lecture, a little old lady at the back of the room got up and said: â€œWhat you have told us is rubbish. The world is really a flat plate supported on the back of a giant tortoise.â€ The scientist gave a superior smile before replying, â€œWhat is the tortoise standing on.â€ â€œYouâ€™re very clever, young man, very clever,â€ said the old lady. â€œBut itâ€™s turtles all the way down!â€</p>
<p>Most people would find the picture of our universe as an infinite <strong>tower of tortoises</strong> rather ridiculous, but why do we think we know better? What do we know about the universe, and how do we know it? Where did the universe come from, and where is it going? Did the universe have a beginning, and if so, what happened before then? What is the nature of time? Will it ever come to an end? Can we go back in time? Recent breakthroughs in physics, made possible in part by fantastic new technologies, suggest answers to some of these longstanding questions. Someday these answers may seem as obvious to us as the earth orbiting the sun â€“ or perhaps as ridiculous as a tower of tortoises. Only time (whatever that may be) will tell. <sup class="footnote-ref"><a href="#fn1" id="fnref1">[1]</a></sup></p>
